import React, { useState } from "react";
import "../styles.css";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

const Account = () => {
    return (
        <>
        <Navbar links="disabled" />
        <section id="account">
            <div className="container">
                <div className="row">
                    <div className="col-12">
                        
                    </div>
                </div>
            </div>
        </section>
        </>
    )
}

export default Account;
